// TopScorers.jsx
import React from 'react';
import goleadores from '../data/goleadores';

const TopScorers = () => {
  return (
    <div>
      <h2>Goleadores</h2>
      <table>
        <thead>
          <tr>
            <th>Jugador</th>
            <th>Equipo</th>
            <th>Goles</th>
          </tr>
        </thead>
        <tbody>
          {goleadores.map((jugador, index) => (
            <tr key={index}>
              <td>{jugador.nombre}</td>
              <td>{jugador.equipo}</td>
              <td>{jugador.goles}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default TopScorers;
